  const url = `api.openweathermap.org/data/2.5/weather?q=hyderabad&appid=${API_KEY}`;
  fetch(url)
    .then((res) => console.log(res.json()))
    .then((data) => console.log(data));

  // }
  return (
    <div className="main">
      <Header />
    </div>
  );
}

export default Main;
